import {Text, StyleSheet, View} from "react-native";

const Contant = () => {
  const greeting = {color: "Red"};
  return (
    <View>
      <Text style={styleText.textStyle}>This is the Contant</Text>
      <Text style={styleText.fontSize}>my name is Zaid</Text>
    </View>
  );
};
const styleText = StyleSheet.create({
  textStyle: {
    color: "blue",
    fontSize: 45,
    textAlign: "center",
    height: 65,
    padding: 12,
  },
  nameStyle: {
    fontSize: 20,
  },
});

export default Contant;
